function prettify(t){let e=Object.keys(texts.data).filter(e=>e.includes(t));return null!=texts.data[e[0]]?lang=texts.data[e[0]]:lang=prettifyFallback(t),lang}function prettifyFallback(t){const e=t;var r="err";if("string"==typeof e){const t=e.charAt(0),n=t.toUpperCase(),a=e.substring(1);r=n+a}return r}const texts=require("./-texts.min.js");module.exports={prettify:prettify};